DELETE	dst
FROM	[dbo].[refOnlineTaxonomy] dst
	LEFT JOIN [#refOnlineTaxonomy] src ON dst.[NodeId] = src.[NodeId]
WHERE	src.[NodeId] IS NULL;

UPDATE	dst
SET	[SearchIndexId] = src.[SearchIndexId]
,	[Description] = src.[Description]
FROM	[dbo].[refOnlineTaxonomy] dst
JOIN	[#refOnlineTaxonomy] src ON dst.[NodeId] = src.[NodeId]
WHERE	(src.[SearchIndexId] IS NULL AND dst.[SearchIndexId] IS NOT NULL) OR (src.[SearchIndexId] IS NOT NULL AND dst.[SearchIndexId] IS NULL) OR src.[SearchIndexId] <> dst.[SearchIndexId]
OR	(src.[Description] IS NULL AND dst.[Description] IS NOT NULL) OR (src.[Description] IS NOT NULL AND dst.[Description] IS NULL) OR src.[Description] <> dst.[Description];

INSERT	[dbo].[refOnlineTaxonomy] (
	[NodeId], [SearchIndexId], [Description]
)
SELECT	src.[NodeId], src.[SearchIndexId], src.[Description]
FROM	[#refOnlineTaxonomy] src
	LEFT JOIN [dbo].[refOnlineTaxonomy] dst ON dst.[NodeId] = src.[NodeId]
WHERE	dst.[NodeId] IS NULL;

